import Card from '../ui/Card';
import classes from './PatientItem.module.css'; 

function PatientItem (props)
{
    return (
    <li className={classes.item}>
        <Card>
            <h3>{props.name}</h3>
            {props.location}
            {props.birthdate}
            {props.ethnicity}
            {props.language}
            {props.gender}

            <button>View Patient</button>

            id={patient.id}
        </Card>
    </li>);
}

export default PatientItem;
